  /** Este Topic agrupa a las clases especficas del avalo, as como sus atributos.
   */
  TOPIC Avaluos =
    OID AS INTERLIS.UUIDOID;
    DEPENDS ON Operacion_V2_9_6.Operacion;

    !!@ ili2db.dispName = "(Avalos) Tabla Calificacin de la Construccin"
    CLASS AV_Tabla_Calificacion_Construccion =
      !!@ ili2db.dispName = "Valor M2 de construccin"
      Valor_M2_Construccion : TEXT*20;
      !!@ ili2db.dispName = "Uso"
      Uso : Avaluos_V2_9_6.AV_UsoUConsTipo;
      !!@ ili2db.dispName = "Puntuacin"
      Puntuacion : TEXT*20;
    END AV_Tabla_Calificacion_Construccion;

    !!@ ili2db.dispName = "(Avalos) Tipologa de la construccin"
    CLASS AV_Tipologia_Construccion =
      !!@ ili2db.dispName = "Identificador de la tipologa"
      Id_Tipologia : TEXT*20;
      !!@ ili2db.dispName = "Descripcin de la tipologa"
      Descripcion_Tipologia : TEXT;
      !!@ ili2db.dispName = "Uso"
      Uso : TEXT;
      !!@ ili2db.dispName = "Valor unitario"
      Valor_Unitario : 0 .. 100000000000000000000000000000 [LADM_COL_V1_3.COP];
    END AV_Tipologia_Construccion;

    /** Esta clase permite gestionar las zonas fsicamente homogneas definidas para el avalo y que delimitan las zonas que tienen caractersticas fsicas similares. REVISAR DOCUMENTACIN
     */
    !!@ ili2db.dispName = "(Avalos) Zona homognea fsica rural"
    CLASS AV_Zona_Homogenea_Fisica_Rural =
      /** Cdigo nico del registro de la instancia de ZonaHomegeneaFisca.
       */
      !!@ ili2db.dispName = "Cdigo"
      Codigo : MANDATORY TEXT*7;
      !!@ ili2db.dispName = "Cdigo zona fsica"
      Codigo_Zona_Fisica : MANDATORY TEXT*20;
      !!@ ili2db.dispName = "rea homognea tierra"
      Area_Homogenea_Tierra : 0.00 .. 99999999999999990000000.00;
      !!@ ili2db.dispName = "Disponibilidad agua"
      Disponibilidad_Agua : Avaluos_V2_9_6.AV_DisponibilidadAguaTipo;
      !!@ ili2db.dispName = "Influencia vial"
      Influencia_Vial : Avaluos_V2_9_6.AV_InfluenciaVialRuralTipo;
      !!@ ili2db.dispName = "Uso actual del suelo"
      Uso_Actual_Suelo : Avaluos_V2_9_6.AV_UsoSueloRuralTipo;
      !!@ ili2db.dispName = "Norma uso del suelo"
      Norma_Uso_Suelo : TEXT*250;
      !!@ ili2db.dispName = "Vigencia"
      Vigencia : INTERLIS.XMLDate;
      /** Definicin de la geometra espacial georreferenciada de la zona homognea fsica, delimitada mediante un polgono que contiene sus linderos y la superficie ocupada.
       */
      !!@ ili2db.dispName = "Geometra"
      Geometria : MANDATORY ISO19107_PLANAS_V1.GM_MultiSurface3D;
    END AV_Zona_Homogenea_Fisica_Rural;

    !!@ ili2db.dispName = "(Avalos) Zona homognea fisca urbana"
    CLASS AV_Zona_Homogenea_Fisica_Urbana =
      !!@ ili2db.dispName = "Cdigo"
