       */
      !!@ ili2db.dispName = "Geometra"
      Geometria : MANDATORY ISO19107_PLANAS_V1.GM_MultiSurface3D;
    END AV_Zona_Homogenea_Geoeconomica_Rural;

  END Avaluos;

END Avaluos_V2_9_6.
